import React from "react";
import "../assets/homepage.scss";
import Card from "../Card";
import anna from "../assets/images/anna.jpg";
import taylour from "../assets/images/taylour.jpg";
import kelli from "../assets/images/kelli.jpg";



function Homepage() {

    var users = [
        {
            image: anna,
            name: "Annastasshia Ames",
            age: 32,
            location: "Savannah, GA",
            description: "Anime, Video Games, All Things Nerdy",
            profileUrl: "https://warm-badlands-80819.herokuapp.com/"
        },
        {
            image: kelli,
            name: "Kelli Jarrell",
            age: 27,
            location: "Savannah, GA",
            description: "Anime, Video Games, All Things Nerdy",
            profileUrl: "https://warm-badlands-80819.herokuapp.com/"
        },
        {
            image: taylour,
            name: "Taylour Maggart",
            age: 35,
            location: "Savannah, GA",
            description: "Anime, Video Games, All Things Nerdy",
            profileUrl: "https://warm-badlands-80819.herokuapp.com/"
        }
    ]
    return (
        <div>
            {/* <section id="home"
                className="jumbotron  jumbotron-fluid"
                style={{ textAlign: "center" }}>
                <div className="container">
                    <img src={NamePlate} style={{ height: "auto", width: "60%" }} />

                </div>
            </section> */}
            <div className="container">
                <div className="row">

                    <div className="demo">
                        <header className="demo__header"></header>
                        <div className="demo__content">
                            <div className="demo__card-cont">

                                {users.map(user => (

                                    <Card
                                        image={user.image}
                                        name={user.name}
                                        age={user.age}
                                        location={user.location}
                                        description={user.description}
                                        profileUrl={user.url}

                                    />
                                ))}
                            </div>
                            <p className="demo__tip">Swipe left or right</p>
                        </div>
                    </div>


                </div>
            </div>
        </div>
    )
}

export default Homepage;
